import { Tabs } from 'antd';
import { Button } from 'antd/lib/radio';
const { TabPane } = Tabs;

const BgAtas = () => (
  <div className="card-container" style={{marginLeft:"56px"}}>
    <Tabs type="card" style={{height: "100",width: "300px"}} >
      <TabPane tab="General Report" key="1">
        <link>Content of Tab Pane 1</link>
      </TabPane>

    </Tabs>
  </div>
);

export default BgAtas;
